(5, 'Kuin Cukurukuk', 'Jalan Kuin Cukurukuk, Banjarmasdsinasdasd Selatan, Banjarmasin', 'Kawasan wisata sungai yang menawarkan pemandangan khas Basdsadasdsadadetreatrewerftqw4rgw', -3.3325, 114.573, 'Screenshot 2025-01-28 181847.png,Screenshot 2025-01-31 200441.png,Screenshot 2025-02-01 195618.png,Screenshot 2025-02-04 235503.png,Screenshot_2025-02-16_013645.png,Screenshot_2025-02-28_174853.png', '2025-04-19 16:09:07', 'Banjarmasin Timur'),
(6, 'Pelelangan Ikan RI Ilir', 'Kuin Selatan, Banjarmasin Selatan, Banjarmasin', 'Tempat pelelangan ikan tradisional di tepi sungai, tempat wisatawan dapat melihat aktivitas jual-beli ikan segar oleh nelayan lokal.asa', -3.335, 114.57, '', '2025-04-19 16:09:07', 'Banjarmasin'),
(7, 'Rumah Makan Wan Resto', 'Jalan Kuin Selatan, Banjarmasin Selatan, Banjarmasin', 'Rumah makan yang menyajikan hidangan khas Banjar seperti soto Banjar dan ikan bakar, cocok untuk wisata kuliner.', -3.33, 114.575, 'wan_resto.jpg', '2025-04-19 16:09:07', 'Banjarmasin'),
(8, 'Museum Kayu Baimbai', 'Banjarmasin Selatan, Banjarmasin', 'Museum kecil yang menyimpan koleksi benda-benda tradisional Banjar, termasuk kerajinan kayu.', -3.328, 114.58, '', '2025-04-19 16:09:07', 'Banjarmasin'),
(11, 'Jembatan Bromo', 'Jalan Bromo, Banjarmasin Selatan, Banjarmasin', 'Jembatan bersejarah yang menjadi salah satu ikon Banjarmasin, menawarkan pemandangan sungai yang indah.', -3.32, 114.595, 'jembatan_bromo.jpg', '2025-04-19 16:09:07', 'Banjarmasin'),
(12, 'Makam Habib Battilantang', 'Banjarmasin Selatan, Banjarmasin', 'Makam tokoh agama yang sering dikunjungi untuk ziarah, menyimpan nilai sejarah dan religi.', -3.315, 114.59, 'makam_habib_battilantang.jpg', '2025-04-19 16:09:07', 'Banjarmasin'),
(13, 'Makam Datu Anggih Amin', 'Banjarmasin Selatan, Banjarmasin', 'Makam tokoh bersejarah yang menjadi tempat ziarah bagi masyarakat Banjarmasin.', -3.31, 114.585, 'makam_datu_anggih_amin.jpg', '2025-04-19 16:09:07', 'Banjarmasin'),
(14, 'RM. Soto Bawah Jembatan', 'Jalan Pasar Lama, Banjarmasin Timur, Banjarmasin', 'Rumah makan terkenal dengan soto Banjar yang lezat, terletak di bawah jembatan dengan suasana khas tepi sungai.', -3.305, 114.6, 'soto_bawah_jembatan.jpg', '2025-04-19 16:09:07', 'Banjarmasin'),
(15, 'Tugu 9 November 1945', 'Jalan Banua Anyar, Banjarmasin Timur, Banjarmasin', 'Monumen bersejarah yang memperingati perjuangan rakyat Banjarmasin pada 9 November 1945, cocok untuk wisata sejarah.', -3.3, 114.61, 'tugu_9_november_1945.jpg', '2025-04-19 16:09:07', 'Banjarmasin'),
(16, 'Keramba Ikan Banua Anyar', 'Sungai Banua Anyar, Banjarmasin Timur, Banjarmasin', 'Kawasan keramba ikan di Sungai Banua Anyar, tempat wisatawan dapat melihat budidaya ikan dan aktivitas nelayan.', -3.295, 114.615, 'keramba_ikan_banua_anyar.jpg', '2025-04-19 16:09:07', 'Banjarmasin'),
